import {FaShoppingCart} from "react-icons/fa"
import logo from "./Daco_5715743.png"
const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row">
        <img src={logo} alt="" />
      </div>
      <div>
        <p>Home</p>
        <FaShoppingCart/>
      </div>
    </div>
  )
};

export default Navbar;
